void UsimagToolGUI::cb_Ok3_i(Fl_Button*, void*) {
  panelRenameVolumes->hide();
char which = RenameWhich->value()[0];
unsigned int pos = (unsigned int)( RenamePosition->value() );
switch( which ){
case 'S':
	this->RenameScalar( pos, NewNameEdit->value() );
	break;
case 'T':
	this->RenameTensor( pos, NewNameEdit->value() );
	break;
case 'M':
	this->RenameModel( pos, NewNameEdit->value() );
	break;
default:
	break;
};
}
